import React, { Component } from 'react'

export default class RollDice extends Component {

    handleClick(){
        const randomNumberPlay = Math.round(Math.random() * 5);
        const randomNumberData = Math.round(Math.random() * 5);
        const tärningenPlay = this.props.tärningValueProp[randomNumberPlay]
        const tärningenData = this.props.tärningValueProp[randomNumberData]
        console.log(tärningenPlay)
        console.log(tärningenData)
    }

    render() {
        return (
            <div>
                <button onClick={ this.handleClick.bind(this) }>Kasta tärningen</button> 
                <p>{tärningenPlay}</p>
                <p>{tärningenData}</p>
            </div>
        )
    }
}
